import React,{Component} from 'react';
import {Grid,Cell} from 'react-mdl';
import Resume from '../Resume.pdf';
import {Link} from 'react-scroll';

export default class LandingPage extends Component{
    render(){
        return(
            <Grid className="landing-page" id="lp">
                <Link style={{color:'white', margin:'auto'}} to="abt" spy={true} smooth={true} >ABOUT</Link>
                <Link style={{color:'white', margin:'auto'}}  to="timeline" spy={true} smooth={true} offset={0} duration= {1000}>TIMELINE </Link>                
                <Link style={{color:'white', margin:'auto'}}  to="contact" spy={true} smooth={true} offset={0} duration= {1000}>CONTACT </Link>   
            <Cell col={12}>
                        <div className="title">
                            <h1>Hi, <br />I'm Saket</h1>
                            <p> Full Stack Developer | Software Engineer | Coder</p><br></br>
                            <p className="resume-text"><a href={Resume} target="blank">View Resume</a></p>
                        </div>
                    </Cell>

            </Grid>
        )
    }
}
